package com.java.basicProgramming;

public class StringReverse {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
     int a=2,b=3;
     int c=0;
     c=a*10+b;
     System.out.println(c);
    int temp=a;
    a=b;
    b=temp;
    int d=a*10+b;
    System.out.println(d);
	}

}
